IF OBJECT_ID('dbo.proc_transform_217', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_217;
GO
CREATE PROCEDURE dbo.proc_transform_217
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_217
    SET payload = LEFT(payload, 1000) + N'|V4-217|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_217;
END
GO
IF OBJECT_ID('dbo.audit_v4_217', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_217 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_217;
GO

CREATE INDEX IDX_staging_217_payload ON dbo.staging_table_217 (id);
